import React, { Component } from 'react';
import Button from "../../components/ui/button"
import Icon from "../../components/ui/icon"
class signin extends Component {
    render() {
        return (
            <div>
                <Button theme="red" style={{ marginTop: '1em' }}>Get Subscription</Button>
                <Button theme='red' style={{ marginTop: '1em' }} > Create Icon </Button>
                <Button theme="red">Start <Icon size={1.2} style={{ color: white }}>navigate_next</Icon></Button>
                <Icon size={2}> Yes</Icon>
            </div>
        );
    }
}

export default signin;
